import { Switch, Route, Link } from 'react-router-dom';


function Home() {
  return <h1>Inicio</h1>;
}

function Contacto() {
  return <h1>Contacto</h1>;
}

function App() {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Inicio</Link>
          </li>
          <li>
            <Link to="/contacto">Contacto</Link>
          </li>
        </ul>
      </nav>
      <section>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/contacto" component={Contacto} />
        </Switch>
      </section>
    </div>
  );
}

export default App;
